import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Image, Form, Button } from "react-bootstrap";

const width_index = '1020';
const heigth_index = '720';
const width_logo = '605';
const heigth_logo = '385';

function App() {
  return (
    //React-boostrap
    <Container fluid>
      <Row>
        <Col>
          <Image
            src="https://images.pexels.com/photos/8448236/pexels-photo-8448236.jpeg"
            fluid
            rounded
            width={width_index}
            height={heigth_index}
          ></Image>
        </Col>
        <Col className="justify-content-center">
          <Image src="/images/1.png" 
            fluid rounded
            width={width_logo}
            height={heigth_logo}></Image>
          <Form>
            <Form.Group className="mb-3">
              <Row></Row>
              <Form.Label>Usuario</Form.Label>
              <Form.Control type="email" placeholder="Ingresa tu usuario" />
            </Form.Group>

            <Button variant="danger" type="submit">
              Ingresar
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
